import React from 'react';
import {useSelector} from "react-redux";
import ContentDetail from "../desktop/content/ContentDetail";
import DesktopKakaoMap from "../desktop/map/DesktopKakaoMap";
import DesktopVideoList from "../desktop/video/DesktopVideoList";

const DesktopHome = () => {
    const {activeContent} = useSelector(state => state.content);
    return (
        <>
            <div className="column is-two-fifths is-fullheight-with-navbar">
                {activeContent ? <ContentDetail /> : <DesktopVideoList />}
            </div>
            <div className="column is-three-fifths is-paddingless is-fullheight-with-navbar">
                <DesktopKakaoMap />
            </div>


        </>
    )
};

export default DesktopHome;
